import React , { Component } from 'react';

class ListUser extends Component {

  state = {
    datauser : [],
    loading : true,
    error:false
  }


  componentDidMount(){
    fetch('https://www.baznaspayakumbuh.com/api/api_tabloit_pulsa.php')
    .then(response=>{
      if(response.ok){
        return response.json();
      }else{
        throw new Error('Ambil Data Gagal');
      }

    })
    .then(
      json=>this.setState({ datauser:json,loading:false})
    )
    .catch(error=>this.state({error:error,loading:true}))
  }

  render(){


        const {error,loading,datauser} = this.state;
        if(error){
          return (<p>{error.message}</p>)
        }

        if(loading){
          return (<p>Loading...</p>)
        }

        const listuser = datauser.map(user=>{
          return (<div>{user.result.title}</div>);

        })


    return (
      <div>
        list Berita
      </div>
    )


  }

}

export default ListUser
